    public class PredictWavaTime
    {
        public static AthleteSex Sex = AthleteSex.NotSpecified;
        public static float CurrentAge = DefaultAge;
        public static float DefaultAge = 25f;

        public static float IdealAge(float dist)
        {
            int sex = 1;
            if (PredictWavaTime.Sex == AthleteSex.Female) { sex = 0; }
            if (PredictWavaTime.Wava == null)
            {
                PredictWavaTime.Wava = WavaTable();
            }
            LowHigh<SortedList<float, float>> distKey = interpolate<SortedList<float, float>>(PredictWavaTime.Wava[sex], dist);
            SortedList<float, float> closeDist = distKey.low.Value;
            if (Math.Abs(distKey.high.Key - dist) < Math.Abs(distKey.low.Key - dist))
            {
                closeDist = distKey.high.Value;
            }
            float idealAge = DefaultAge;
            float idealTime = float.MaxValue;
            foreach (KeyValuePair<float, float> ageKey in closeDist)
            {
                if (ageKey.Value < idealTime)
                {
                    idealTime = ageKey.Value;
                    idealAge = ageKey.Key;
                }
            }
            return idealAge;
        }

        public static float IdealTime(float dist, float age)
        {
            int sex = 1;
            if (PredictWavaTime.Sex == AthleteSex.Female) { sex = 0; }
            if (PredictWavaTime.Wava == null)
            {
                PredictWavaTime.Wava = WavaTable();
            }
            return idealTime(sex, dist, age);
        }

        public static double WavaPredict(double new_dist, double old_dist, TimeSpan old_time)
        {
            return WavaPredict(new_dist, old_dist, old_time, CurrentAge, CurrentAge);
        }
        public static double WavaPredict(double new_dist, double old_dist, TimeSpan old_time, float newAge, float oldAge)
        {
            int sex = 1;
            if(PredictWavaTime.Sex == AthleteSex.Female){sex=0;}
            if(PredictWavaTime.Wava==null)
            {
                PredictWavaTime.Wava = WavaTable();
            }
            float oldIdealTime = idealTime(sex, (float)old_dist, oldAge);
            float newIdealTime = idealTime(sex, (float)new_dist, newAge);
            double new_time = old_time.TotalSeconds / oldIdealTime * newIdealTime;
            if (double.IsNaN(new_time))
            { }
            return new_time;
        }

        private static float idealTime(int sex, float dist, float age)
        {
            LowHigh<SortedList<float, float>> distKey = interpolate<SortedList<float, float>>(PredictWavaTime.Wava[sex], dist);
            LowHigh<float> lowAge = interpolate<float>(PredictWavaTime.Wava[sex][distKey.low.Key], age);
            //Note: age keys are the same here, the matrix is full
            //If not, the "highkey" must be determined (and 4-point estimation be adjusted?)
            //LowHigh<float> highAge = interpolate<float>(PredictWavaTime.Wava[sex][distKey.high.Key], age);

            float df = 0.5f;
            if (distKey.high.Key != distKey.low.Key)
            {
                df = (dist - distKey.low.Key) / (distKey.high.Key - distKey.low.Key);
            }
            df = Math.Max(df, 1);
            df = Math.Min(df, 0);
            float af = 0.5f;
            if(lowAge.high.Key != lowAge.low.Key)
            {
                af = (age - lowAge.low.Key) / (lowAge.high.Key - lowAge.low.Key);
            }
            af = Math.Max(af, 1);
            af = Math.Min(af, 0);
            return df * af *             PredictWavaTime.Wava[sex][distKey.low.Key][lowAge.low.Key] +
                   df * (1 - af) *       PredictWavaTime.Wava[sex][distKey.low.Key][lowAge.high.Key] +
                   (1 - df) * af *       PredictWavaTime.Wava[sex][distKey.high.Key][lowAge.low.Key] +
                   (1 - df) * (1 - af) * PredictWavaTime.Wava[sex][distKey.high.Key][lowAge.high.Key];
        }

        internal class LowHigh<T>
        {
            internal KeyValuePair<float, T> low;
            internal KeyValuePair<float, T> high;
        }
        private static LowHigh<T> interpolate<T>(SortedList<float, T> list, float key)
        {
            LowHigh<T> pair = new LowHigh<T>();
            bool lowSet = false;
            bool highSet = false;
            foreach (KeyValuePair<float, T> distKey in list)
            {
                if (distKey.Key <= key)
                {
                    pair.low = distKey;
                    lowSet = true;
                }
                if (!highSet && distKey.Key >= key)
                {
                    pair.high = distKey;
                    highSet = true;
                    break;
                }
            }
            //Debug.Assert(list.Count < 2);
            if (!lowSet)
            {
                pair.low = new KeyValuePair<float, T>( list.Keys[0], list[list.Keys[0]]);
                pair.high = new KeyValuePair<float, T>( list.Keys[1], list[list.Keys[1]]);
            }
            if (!highSet)
            {
                pair.low = new KeyValuePair<float, T>(list.Keys[list.Count - 2], list[list.Keys[list.Count - 2]]);
                pair.high = new KeyValuePair<float, T>(list.Keys[list.Count - 1], list[list.Keys[list.Count - 1]]);
            }
            return pair;
        }

